    ALLY_CODES_DARK: ['#FF6E00', '#D31A28', '#6C2777', '#6FB384', '#01BFBF', '#2C7ED0', '#000000'], // needs a white dot
    ALLY_CODES_LIGHT: ['#FFFA00', '#FF7B96', '#D053FF', '#46E71B', '#68FFD7', '#ADD4F3', '#FFFFFF'], // needs a black dot
    WHITE_RGBA_CODE: 'rgba(255, 255, 255, 1)', // package use RGBA apparently
